// appId appKey
AV.initialize("qFfnvRupzacWi0W1ItCvVSdt-gzGzoHsz", "5TQTX2K7eGMmtUzVjMflb53k");

function requestPaperById(id){ // 进行查询出文章的数据（标题、阅读量、点赞数等）
	var query = new AV.Query('Paper'); // 声明一个查询连接
	query.equalTo('paperId',id); // 条件查询
	// Promise
	query.find()
		.then(function(datas){
			if(datas.length){
				paper=datas[0];
				renderPaper(); // 渲染文章
				incrementPaperViewNumber(); // 进行阅读量自增+1的操作
			}else{
				alert('没有该文章哦！');
			}
		},function(err){
			alert('服务器开小差哦！');
		})
}
function renderPaper(){ // 渲染数据
	$('#viewNumber').html(['阅读 ',paper.get('viewNumber')].join(''));
	$('#likeNumber').html([paper.get('likeNumber')].join(''));
	if(localStorage.getItem('paperId')){
		$('.iconfont').addClass('active')
	}
}
function incrementPaperViewNumber(){
	paper.increment('viewNumber', 1); // 自增+1
	paper.save(); // 数据保存
}
function incrementPaperLikeNumber(succ,err){
	paper.increment('likeNumber', 1); // 自增+1
	paper.save() // 数据保存，传入回调函数callback（成功或者失败）
		.then(succ,err)
}
function likeClick(){
	if(localStorage){
		if(!localStorage.getItem('paperId')){
			incrementPaperLikeNumber(function(data){
				localStorage.setItem('paperId',paperId)
				$('.iconfont').addClass('active')
				$('#likeNumber').html([data.get('likeNumber')].join(''));
			},function(err){
				alert('服务器开小差哦！');
			})
		}
	}
}